sourcesContent:
const { bucket } = require("../config//firebase");
const { v4: uuidv4 } = require("uuid");

const uploadImage = async (file) => {
  const uniqueFilename = uuidv4() + "-" + file.originalname;
  const blob = bucket.file(uniqueFilename);

  // To lung ghi tp
  const blobStream = blob.createWriteStream({
    metadata: {
      contentType: file.mimetype, // nh dng tp
    },
  });

  // S dng Promise  x l bt ng b
  return new Promise((resolve, reject) => {
    // X l li trong qu trnh upload
    blobStream.on("error", (err) => {
      console.error("Li trong qu trnh upload:", err);
      reject(new Error("Khng th upload nh, vui lng th li sau."));
    });

    // Khi upload hon tt
    blobStream.on("finish", async () => {
      try {
        // To URL cng khai cho nh
        const publicUrl = `https://storage.googleapis.com/${bucket.name}/${blob.name}`;

        // Ghi log qu trnh thnh cng
        console.log("Upload thnh cng, URL:", publicUrl);

        // t quyn cng khai cho file nu cn
        await blob.makePublic();

        resolve(publicUrl);
      } catch (error) {
        console.error("Li khi to URL cng khai:", error);
        reject(new Error("Khng th to URL cng khai cho nh."));
      }
    });

    // Ghi d liu t buffer vo stream
    blobStream.end(file.buffer);
  });
};

module.exports = { uploadImage };

