sourcesContent:
import db from '../models/index';


const createCategory = async (data) => {
  try {
    if (!data.name) {
      return {
        errCode: 1,
        errMessage: "Missing required field: name",
      };
    }

    const newCategory = await db.Category.create({
      name: data.name,
      parentId: data.parentId || null, // Nu khng truyn parentId,  null
    });

    return {
      errCode: 0,
      errMessage: "Create category successfully",
      category: newCategory,
    };
  } catch (e) {
    throw e;
  }
};


const updateCategory = async (data) => {
  try {
    if (!data.id) {
      return {
        errCode: 1,
        errMessage: "Missing category id",
      };
    }

    const category = await db.Category.findByPk(data.id);
    if (!category) {
      return {
        errCode: 1,
        errMessage: "Category not found",
      };
    }

    const updated = await db.Category.update(
      {
        name: data.name || category.name,
        parentId: data.parentId !== undefined ? data.parentId : category.parentId,
      },
      {
        where: { id: data.id },
      }
    );

    if (updated[0] === 0) {
      return {
        errCode: 1,
        errMessage: "Update failed",
      };
    }

    return {
      errCode: 0,
      errMessage: "Update category successfully",
    };
  } catch (e) {
    throw e;
  }
};


const getAllCategories = async () => {
  try {
    const categories = await db.Category.findAll();
    return categories;
  } catch (e) {
    throw e;
  }
};


const deleteCategory = async (categoryId) => {
  try {
    const result = await db.Category.destroy({
      where: { id: categoryId },
    });

    if (!result) {
      return {
        errCode: 1,
        errMessage: "Category not found",
      };
    }

    return {
      errCode: 0,
      errMessage: "Delete category successfully",
    };
  } catch (e) {
    throw e;
  }
};

module.exports = {
  createCategory,
  updateCategory,
  getAllCategories,
  deleteCategory,
};

